import { ChakraProvider } from "@chakra-ui/react";
import theme from "./theme/theme";
import { CarendarTemplate } from "./app/carendar/CarendarTemplate";

export const App = () => {
  return (
    <>
      <ChakraProvider theme={theme}>
        <CarendarTemplate />
      </ChakraProvider>
    </>
  );
};
